import React, { useEffect, useState } from 'react';
import Grid from "@material-ui/core/Grid"
import Paper from "@material-ui/core/Paper"
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import '../../styles/Interfaces.css';


const InterventionsInter = ({

}) => {

    const nbPompiers = 6
    const numCycle = 2
    const cycles = [
        {
            numCycle: 1,
            interPomp1: 100,
            interPomp2: 200,
            interPomp3: 300,
            interPomp4: 400,
            interPomp5: 500,
            interPomp6: 600,
        },
        {
            numCycle: 2,
            interPomp1: 700,
            interPomp2: 800,
            interPomp3: 900,
            interPomp4: 1000,
            interPomp5: 1100,
            interPomp6: 1200,
        }
    ]



    const renderHeaders = () => {
        var components = []
        components.push(
            <TableCell key={0} align="center">Cycle</TableCell>
        )
        for (let i = 1; i <= nbPompiers; i++) {
            components.push(
                <TableCell key={i} align="center">Pompier {i}</TableCell>
            )
        }
        return components
    }

    const renderBudgets = () => {
        const cyclesSorted = cycles.sort((a, b) => a.numCycle - b.numCycle)
        var components = []
        cyclesSorted.forEach((cycle) => {
            var comp = []

            comp.push(
                <TableCell component="th" scope="row" align="center">
                    Cycle n°{cycle.numCycle}
                </TableCell>
            )

            Object.keys(cycle).forEach((key) => {
                if (key != "numCycle") {
                    comp.push(
                        <TableCell key={key} align="center">{cycle[key]}</TableCell>
                    )
                }
            })
            components.push(
                <TableRow key={cycle.numCycle}>
                    {comp}
                </TableRow>
            )
        })
        return (
            components
        )
    }

    return (
        <div className="container">
            <TableContainer component={Paper}>
                <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            {renderHeaders()}
                        </TableRow>
                    </TableHead>
                    <TableBody>
                       {renderBudgets()}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
}

export default InterventionsInter;
